INSERT INTO movies (id,title, tagline, overview, titleEmbedding, taglineEmbedding, overviewEmbedding) VALUES(68726, 'Pacific Rim', 'To Fight Monsters, We Created Monsters', 'When legions of monstrous creatures, known as Kaiju, started rising from the sea, a war began that would take millions of lives and consume humanity"s resources for years on end. To combat the giant Kaiju, a special type of weapon was devised: massive robots, called Jaegers, which are controlled simultaneously by two pilots whose minds are locked in a neural bridge. But even the Jaegers are proving nearly defenseless in the face of the relentless Kaiju. On the verge of defeat, the forces defending mankind have no choice but to turn to two unlikely heroes—a washed-up former pilot (Charlie Hunnam) and an untested trainee (Rinko Kikuchi)—who are teamed to drive a legendary but seemingly obsolete Jaeger from the past. Together, they stand as mankind"s last hope against the mounting apocalypse.', '[0.0323515310883522,0.031948138028383255,-0.05047321319580078,-0.0015476455446332693,-0.010372062213718891,0.00520947715267539,0.06602506339550018,0.01659543626010418,0.09234826266765594,-0.01992739737033844,-0.03633322939276695,-0.043148789554834366,0.012598629109561443,0.0267646387219429,0.0013914857991039753,0.034109119325876236,0.01205587200820446,-0.027308447286486626,0.009241493418812752,-0.10738832503557205,-0.04997220262885094,0.02427894063293934,-0.021671859547495842,0.053794022649526596,-0.03978258743882179,0.06119345501065254,0.0025182797107845545,0.10282260924577713,-0.027932971715927124,-0.07982053607702255,-0.048954132944345474,0.138783261179924,0.03321382775902748,0.03179100155830383,0.011055790819227695,-0.03617768734693527,-0.07099390774965286,0.06382311880588531,0.034648969769477844,-0.04069849103689194,-0.047782331705093384,-0.003917640540748835,0.09080976992845535,0.01347757875919342,-0.01579446718096733,-0.010350135155022144,-0.04073522984981537,0.010702716186642647,0.09908565878868103,